const button1 = document.getElementById("button1");
//creates html audio object

const container = document.getElementById("container");
const canvas = document.getElementById("canvas1");
const file = document.getElementById("fileupload");
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
const ctx = canvas.getContext("2d");
ctx.shadowOffsetX = 2;
ctx.shadowOffsetY = 5;
ctx.shadowBlur = 0;
ctx.shadowColor = "white";
let audioSource;
let analyser;

container.addEventListener("click", function () {
  const audio1 = document.getElementById("audio1");
  audio1.src =
    "data:audio/x-wav;base64, ";

  const audioCtx = new AudioContext();
  audio1.play();
  audioSource = audioCtx.createMediaElementSource(audio1);
  analyser = audioCtx.createAnalyser(); //expose audio time and freq data
  audioSource.connect(analyser);
  analyser.connect(audioCtx.destination);
  analyser.fftSize = 256;
  const bufferLength = analyser.frequencyBinCount;
  const dataArray = new Uint8Array(bufferLength); //convert into special type of array

  const barWidth = 20;
  let barHeight;
  let x;

  function animate() {
    x = 0;
    ctx.clearRect(0, 0, canvas.width, canvas.height); //clear frame
    analyser.getByteFrequencyData(dataArray);
    drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray);
    requestAnimationFrame(animate);
  }
  animate();
});

file.addEventListener("change", function () {
  const files = this.files;
  const audio1 = document.getElementById("audio1");
  audio1.src = URL.createObjectURL(files[0]); //upload file is at index zero
  audio1.load(); //used to update the audio element
  audio1.play();

  audioSource = audioCtx.createMediaElementSource(audio1);
  analyser = audioCtx.createAnalyser(); //expose audio time and freq data
  audioSource.connect(analyser);
  analyser.connect(audioCtx.destination);
  analyser.fftSize = 256;
  const bufferLength = analyser.frequencyBinCount;
  const dataArray = new Uint8Array(bufferLength); //convert into special type of array

  const barWidth = canvas.width / bufferLength;
  let barHeight;
  let x;

  function animate() {
    x = 0;
    ctx.clearRect(0, 0, canvas.width, canvas.height); //clear frame
    analyser.getByteFrequencyData(dataArray);
    drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray);
    requestAnimationFrame(animate);
  }
  animate();
});

function drawVisualiser(bufferLength, x, barWidth, barHeight, dataArray) {
  for (let i = 0; i < bufferLength; i++) {
    barHeight = dataArray[i] * 1.4; //loud sounds produce longAudioer bars
    ctx.save();
    ctx.translate(canvas.width / 2, canvas.height / 2);
    ctx.rotate(i * bufferLength * -4);
    //dynamically change colors - any color can be made from red, green and blue
    //0 is red
    const hue = 250 + i * 2;
    ctx.fillStyle = "hsl(" + hue + ",100%," + barHeight / 3 + "%)";
    ctx.beginPath();
    ctx.arc(0, barHeight, barHeight / 10, 0, Math.PI * 2);

    ctx.arc(0, barHeight / 1.5, barHeight / 20, 0, Math.PI * 2);

    ctx.arc(0, barHeight / 2, barHeight / 30, 0, Math.PI * 2);

    ctx.arc(0, barHeight / 3, barHeight / 40, 0, Math.PI * 2);
    ctx.fill();
    x += barWidth;
    ctx.restore();
  }
}
